const initialState = {
  nastavnici: [],
  nestoDrugo: false,
};

const nastavnici = async (state = initialState, action) => {
  /*  if (action.type === 'GET_NASTAVNICI') {
    return state;
  } */
  if (action.type === 'GET_NASTAVNICI') {
    return {
      type: 'GET_NASTAVNICI',
      data: state.data,
    };
  }
  return state;
};

export default nastavnici;
